ursor for\n		-- recursively search all childs\n		-- the result is a set with the parent and all its distinctive child\n		with recursive cte (hash, name, parent) as (\n			select hash, name, parent\n			from tree\n			where parent = directory\n			union all\n			select t.hash, t.name, t.parent\n			from tree as t\n			inner join cte\n			on t.parent = cte.hash\n		)\n		select childs.hash, i.owner, i.group, i.owner_read_permission, i.group_read_permission, i.others_read_permission \n        from (\n			select * from cte \n			union all select * from tree where hash = directory -- joins parent itself\n			order by hash asc\n		) as childs \n        left join directory d on childs.hash = d.hash\n		left join inodes i on d.inode = i.inode\n		where childs.name regexp filename; -- find childs with name matches file_name\n    declare continue handler for not found set cursor_done = true;\n    \n    -- split input params\n    set directory = substring_index(input, \' \', 1);\n    set filename = substring_index(input, \' \', -1);\n    \n    -- convert directory aliases to actual directory names\n    if directory = input or directory = \'.\' then -- if user does not supply directory, it should just be current directory in find\n		set directory = TRIM(TRAILING \'/\' FROM @cd); \n	elseif directory = \'..\' then\n		set directory = (select parent from tree where hash = @cd);\n    end if;\n	\n    set parent_path = substring_index(directory, \'/\', 1);\n    if parent_path = \'.\' then\n        set directory = concat(@cd, \'/\', substr(directory from (instr(directory, \'/\') + 1)));\n    elseif parent_path = \'..\' then\n        set directory = concat((select parent from tree where hash = @cd), \'/\', substr(directory from (instr(directory, \'/\') + 1)));\n    end if;\n    \n	-- Use a tempoary table to store all matched rows\n    drop temporary table if exists cmd_result;\n    create temporary table cmd_result (\n		result varchar(255) not null\n    );\n    \n    open file_cursor;\n    parse_files: loop\n		fetch file_cursor into matched_hash, temp_owner, temp_group, temp_owner_read, temp_group_read, temp_others_read;\n        if cursor_done then\n			leave parse_files;\n		end if;\n        if (\n			(temp_owner = @current_user and temp_owner_read = \'r\') or\n			(temp_group = @current_user_group and temp_group_read = \'r\') or\n			(temp_others_read = \'r\')\n		) then\n			insert into cmd_result(result) values (matched_hash);\n		else\n            # user does not have read permission\n            insert into cmd_result(result) values (concat(\"find: \", matched_hash, \": Permission Denied\"));\n        end if;\n	end loop;\n    close file_cursor;\n    \n    -- need to call \'ls -l\' for results\nend//\nDELIMITER ;\n\n-- test cases\nset @current_user = \'d5lei\';\nset @current_user_group = \'staff\';\nset @cd = \'/Users/d5lei/repo/ece356/Project\';\ncall find(\"./test below\");\nselect * from cmd_result;\n\n-- usage:\n-- from bash:  find [directory] [filename]\n-- from mysql: call find([directory filename])'),(14446450,_binary 'use ece356_unix_fs;\n\n-- substring_list: returns all matched string within a text\ndrop procedure if exists substring_list;\ndelimiter //\ncreate procedure substring_list(\n	filename varchar(255),\n    data text,\n    pattern varchar(255)\n)\nbegin\n    declare pattern_len int default CHAR_LENGTH(pattern);\n    declare output_str text default \'\';\n    declare occurence int default 1;\n    while regexp_instr(data, binary pattern, 1, occurence) != 0 do\n		insert into cmd_result select concat(filename, \": \", convert(regexp_substr(data, binary pattern, 1, occurence) using \'utf8\'));\n        -- set output_str = CONCAT(output_str, regexp_substr(data, pattern, 1, occurence), \'\\n\');\n        set occurence = occurence + 1;\n    end while;\nend//\ndelimiter ;\n\ndrop procedure if exists grep;\ndelimiter //\ncreate procedure grep (\n    in input varchar(255)\n)\nbegin\n	-- input params\n    declare pattern varchar(255) default \'\';\n    declare filename varchar(255) default \'\';\n    declare parent varchar(255) default \'\';\n    \n	-- use a file cursor to iterate through all matched files\n    declare cursor_done int default false;\n    declare matched_file varchar(255) default null;\n    declare matched_path varchar(255) default null;\n    declare matched_data blob default null;\n    declare temp_owner varchar(255) default null;\n    declare temp_group varchar(255) default null;\n    declare temp_owner_read varchar(255) default null;\n    declare temp_group_read varchar(255) default null;\n    declare temp_others_read  varchar(255) default null;\n	declare file_cursor cursor for\n		select t.hash, t.name, da.data, i.owner, i.group, \n				i.owner_read_permission, i.group_read_permission, i.others_read_permission from tree t\n			left join directory d on t.hash = d.hash\n			left join inodes i on d.inode = i.inode\n			left join data da on i.inode = da.inode\n			where t.hash regexp filename and t.parent = @cd and i.type = \'-\'; -- match files only\n    declare continue handler for not found set cursor_done = true;\n	\n    -- Use a tempoary table to store all matched rows\n    drop temporary table if exists cmd_result;\n    create temporary table cmd_result (\n		result varchar(255) not null\n    );\n    \n    -- split input params\n    set pattern = substring_index(input, \' \', 1);\n    set filename = substring_index(input, \' \', -1);\n    \n    -- need to let regex to match full line\n    set pattern = if(pattern like \".*%\", pattern, concat(\".*\", pattern));\n	set pattern = if(pattern like \"%.*\", pattern, concat(pattern, \".*\"));\n    \n    open file_cursor;\n    parse_files: loop\n		fetch file_cursor into matched_path, matched_file, matched_data, \n				temp_owner, temp_group, temp_owner_read, temp_group_read, temp_others_read;\n        if cursor_done then\n			leave parse_files;\n		end if;\n        if (\n			(temp_owner = @current_user and temp_owner_read = \'r\') or\n			(temp_group = @current_user_group and temp_group_read = \'r\') or\n			(temp_others_read = \'r\')\n		) then\n			call substring_list(matched_file, matched_data, pattern);\n		else\n            # user does not have read permission\n            insert into cmd_result(result) values (concat(\"grep: \", matched_path, \": Permission Denied\"));\n        end if;\n	end loop;\n    close file_cursor;\n	\nend//\nDELIMITER ;\n\n-- test cases\nset @current_user = \'d5lei\';\nset @current_user_group = \'staff\';\nset @cd = \'/Users/d5lei/repo/ece356/Project\';\ncall grep(\'lines.*empty demo_file\');\nselect * from cmd_result;\n\n-- usage:\n-- from bash:  grep [filename] [file_name]\n-- from mysql: call grep([filename file_name])'),(14446451,_binary '# purpose: generate bunch of insert commands for creating dummy data\n# run \'brew install tree\' if you don\'t have tree command on your mac\n# copy your tree to the following block, with current dir name:\n\nimport re\nfrom nltk.tree import *\ncurrent_dir = \"lab2\"\ntree = \"\"\"\n.\nâ”œâ”€â”€ LAB1\nâ”‚Â Â  â”œâ”€â”€ 3-1.sql\nâ”‚Â Â  â”œâ”€â”€ 3-2.sql\nâ”‚Â Â  â”œâ”€â”€ 3-3.sql\nâ”‚Â Â  â”œâ”€â”€ 3-4.sql\nâ”‚Â Â  â”œâ”€â”€ 3-5.sql\nâ”‚Â Â  â”œâ”€â”€ 3-6.sql\nâ”‚Â Â  â”œâ”€â”€ Batting.csv\nâ”‚Â Â  â”œâ”€â”€ a1-d5lei\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ baseballQueries.sql\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ ece356a1-corrected.pdf\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ lahman2016-tables.sql\nâ”‚Â Â  â”‚Â Â  â””â”€â”€ loadBatting.sql\nâ”‚Â Â  â”œâ”€â”€ a1-d5lei.zip\nâ”‚Â Â  â”œâ”€â”€ d5lei_ece356_a1\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ baseballQueries.sql\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ ece356a1-d5lei.pdf\nâ”‚Â Â  â”‚Â Â  â”œâ”€â”€ lahman2016-tables.sql\nâ”‚Â Â  â”‚Â Â  â””â”€â”€ loadBatting.sql\nâ”‚Â Â  â”œâ”€â”€ d5lei_ece356_a1.zip\nâ”‚Â Â  â”œâ”€â”€ ece356a1-d5lei.pdf\nâ”‚Â Â  â”œâ”€â”€ ece356lab1.docx\nâ”‚Â Â  â”œâ”€â”€ lab-tables-nullable.sql\nâ”‚Â Â  â”œâ”€â”€ lahman2016\\ (1).sql\nâ”‚Â Â  â”œâ”€â”€ lahman2016-batting.sql\nâ”‚Â Â  â”œâ”€â”€ lahman2016-data.sql\nâ”‚Â Â  â”œâ”€â”€ lahman2016-tables-nokey.s