.directory_template, (self.hash, ino))\n        \n        # if this is not a directory, insert data\n        if not stat.S_ISDIR(self.inode.st_mode):\n            cursor.execute(self.data_template, (ino, self.convertToBinaryData()))\n\n# db connection\ntry:\n    connection = mysql.connector.connect(\n        host=\'127.0.0.1\',\n        database=\'ece356_unix_fs\',\n        user=\'root\',\n        password=\'ece356\' # you might need to change this\n    )\n    mycursor = connection.cursor()\n    print(\"db authentication complete\")\nexcept mysql.connector.Error as error:\n    print(\"Failed inserting BLOB data into MySQL table {}\".format(error))\n    sys.exit()\n            \n# current full directory path\ncwd = os.getcwd()\n\n# sub directories\nparent_dir = \"NULL\"\nleafs = [] #Leaf\nlinks = [] #String\n\nfor (root, dirs, files) in os.walk(\".\", topdown=True):\n    if root == \".\":\n        hash = cwd\n        parent = \"NULL\"\n    else:\n        hash = cwd + root[1:]\n        parent = os.path.dirname(hash)\n\n    # add current directory\n    dirname = os.path.basename(hash)\n    leafs.append(Leaf(hash, dirname, parent, os.lstat(hash)))\n    \n    for child_file in files:\n        filepath = hash + \"/\" + child_file\n        print(filepath)\n        leafs.append(Leaf(filepath, child_file, hash, os.lstat(filepath)))\n        # if this file is a link, store them\n        if stat.S_ISLNK(os.lstat(filepath).st_mode):\n            links.append(filepath)\n\n# insert nodes\nfor l in leafs:\n    l.insert_to_db(mycursor)\n\nfor l in links:\n    symlink_template = \"insert into `symbolic_links` values (%s, %s);\"\n    mycursor.execute(symlink_template, (l, os.readlink(l)))\n    \nconnection.commit()\nmycursor.close()\nconnection.close()\n\nprint(\"done without errors\")\n   '),(14446455,_binary 'import os\nimport sys\nimport pwd\nimport grp\nimport stat\nimport ctypes\nimport mysql.connector\nfrom mysql.connector import Error\n\n# a file or directory\nclass Leaf:\n   