t, enrollment int,\n       	     	      primary key(courseID,section,termCode),\n       	     	      foreign key (instID) references Instructor(instID),\n       	     	      foreign key (roomID) references Classroom(roomID),\n		      foreign key (courseID) references Course (courseID));\ninsert into Offering values (\'ECE356\'  , 1 , 1191 , \'E74417\' , 1 , 64 ),\n       	    	     	    (\'ECE356\'  , 2 , 1191 , \'E74417\' , 3 , 123 ),\n			    (\'ECE290\'  , 1 , 1191 , \'E74053\' , 3 , 102 ),\n			    (\'ECE390\'  , 1 , 1191 , \'E74053\' , 3 , 102 ),\n			    (\'MATH117\' , 1 , 1189 , \'RCH111\' , 5 , 89 );\n\n'),(14446512,_binary 'USE ChessGames;\n\n# q1\nselect (select count(winner) as W from Games where winner = \"white\")/count(*) from Games;\n\n# q2\nselect avg(turns) from Games where winner = \"white\";\nselect avg(turns) from Games where winner = \"black\";\n\n# q3, since first move of chess can only be knight or pawn, filter out ones that start ones with N (knight)\nselect (select count(move) as M from Moves where move_index = 1 and move not like \"N%\")/count(*) from Games;\n\n# q4, white only moves on odd move_index\n# KNIGHT\nselect avg(knight1) from \n	(select id, (min(move_index)-1)/2 as knight1 from (select * from Moves where (move_index % 2) = 1) as white_moves where move like \"N%\" group by id) as first_knight;\n# BISHOP\nselect avg(bishop1) from \n	(select id, (min(move_index)-1)/2 as bishop1 from (select * from Moves where (move_index % 2) = 1) as white_moves where move like \"B%\" group by id) as first_bishop;\n# ROOK\nselect avg(rook1) from \n	(select id, (min(move_index)-1)/2 as rook1 from (select * from Moves where (move_index % 2) = 1) as white_moves where move like \"R%\" group by id) as first_rook;\n    \n# q5, black only moves on even move_index\n# KNIGHT\nselect avg(knight1) from \n	(select id, (min(move_index)-1)/2 as knight1 from (select * from Moves where (move_index % 2) = 0) as black_moves where move like \"N%\" group by id) as first_knight;\n# BISHOP\nselect avg(bishop1) from \n	(select id, (min(move_index)-1)/2 as bishop1 from (select * from Moves where (move_index % 2) = 0) as black_moves where move like \"B%\" group by id) as first_bishop;\n# ROOK\nselect avg(rook1) from \n	(select id, (min(move_index)-1)/2 as rook1 from (select * from Moves where (move_index % 2) = 0) as black_moves where move like \"R%\" group by id) as first_rook;\n    \n'),(14446513,_binary '# Test cases\n# 1: Pass with valid params\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nCALL switchSection(\"ECE356\", 1, 2, 1191, 10, @errorcode);\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nSELECT @errorcode;\n\n# 2: Fail with -1\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nCALL switchSection(\"Invalid\", 1, 2, 1191, 10, @errorcode); # Invalid courseID\nCALL switchSection(\"ECE356\", 5, 2, 1191, 10, @errorcode); # Invalid section1\nCALL switchSection(\"ECE356\", 1, 5, 1191, 10, @errorcode); # Invalid section2\nCALL switchSection(\"ECE356\", 1, 2, 11910, 10, @errorcode); # Invalid termCode\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\n\n# 3: Fail with -2\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nCALL switchSection(\"ECE356\", 1, 2, 1191, 1000, @errorcode);\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nSELECT @errorcode;\n\n# 4: Fail with -3\nBEGIN;\nUPDATE `University`.`Offering` SET `enrollment` = \'54\' WHERE (`courseID` = \'ECE356\') and (`section` = \'1\') and (`termCode` = \'1191\');\nUPDATE `University`.`Offering` SET `enrollment` = \'133\' WHERE (`courseID` = \'ECE356\') and (`section` = \'2\') and (`termCode` = \'1191\');\nCOMMIT;\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nCALL switchSection(\"ECE356\", 1, 2, 1191, 10, @errorcode);\nSELECT * FROM Offering WHERE (section = 1 OR section = 2) AND courseID = \"ECE356\";\nSELECT @errorcode;'),(14446514,_binary 'USE University;\n\nDROP PROCEDURE IF EXISTS switchSection;\nDELIMITER //\nCREATE PROCEDURE switchSection (\n	IN courseID char(8), \n    IN section1 int, \n    IN section2 int, \n    IN termCode decimal(4), \n    IN quantity int,\n    OUT error_flag int\n)\nBEGIN\n    DECLARE error_code INT DEFAULT 0;\n        \n    START TRANSACTION; # same as set autocommit=0?\n	\n    # -1: Do not exist cases\n    IF NOT EXISTS(\n		SELECT * FROM Offering WHERE Offering.courseID = courseID\n		AND Offering.section = section1 AND Offering.termCode = termCode\n    ) THEN\n		SET error_code = -1;\n	END IF;\n    \n    IF NOT EXISTS(\n		SELECT * FROM Offering WHERE Offering.courseID = courseID\n		AND Offering.section = section2 AND Offering.termCode = termCode\n    ) THEN\n		SET error_code = -1;\n	END IF;\n    \n    IF (quantity <= 0 OR section1 = section2) THEN\n		SET error_code = -1;\n	END IF;\n        \n	# -2: reduce enrollment cases\n    IF error_code != 0 THEN\n		SET error_code = error_code;# do nothing option?\n    ELSEIF ((SELECT Enrollment FROM Offering WHERE Offering.courseID=courseID AND Offering.section = section1 AND Offering.termCode = termCode) < quantity) \n    THEN\n		SET error_code = -2;\n	ELSE\n		UPDATE Offering SET Enrollment = Enrollment - quantity WHERE \n			Offering.courseID=courseID AND Offering.section = section1 AND Offering.termCode = termCode;\n	END IF;\n    \n    # -3: increase enrollment cases\n    UPDATE Offering SET Enrollment = Enrollment + quantity WHERE \n			Offering.courseID=courseID AND Offering.section = section2 AND Offering.termCode = termCode;\n    IF error_code != 0 THEN\n		SET error_code = error_code;# do nothing option?\n    ELSEIF NOT ((SELECT Enrollment FROM Offering WHERE Offering.courseID=courseID AND Offering.section = section2 AND Offering.termCode = termCode) \n		< (SELECT Capacity FROM Offering LEFT JOIN Classroom ON Offering.roomID = Classroom.roomID\n		WHERE Offering.courseID=courseID AND Offering.section = section2 AND Offering.termCode = termCode)) \n    THEN\n		SET error_code = -3;\n	END IF;\n    \n    IF (error_code = 0) THEN\n		COMMIT;\n	ELSE\n		ROLLBACK;\n	END IF;\n    \n    SELECT error_code INTO error_flag;\nEND//\nDELIMITER ;'),(14448855,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14448867,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14448900,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14448912,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14448961,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14449031,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this file.\nThis Line Has All Its First Character Of The Word With Upper Case.\n\nTwo lines above this line is empty.\nAnd this is the last line.'),(14449069,_binary 'THIS LINE IS THE 1ST UPPER CASE LINE IN THIS FILE.\nthis line is the 1st lower case line in this f